//space optimized dp
iint GetFibonacci(int n) {
        if(n==0){
                return n;
        }
        if(n==1 || n==2){
                return 1;
        }
        int a1=1;
        int a2=1;
        for(int i=3;i<=n;i++){
                a1=a1+a2;
                swap(a1,a2);
        }
        return a2;}

