Def solution(s):
    max_sum = 0
    current_sum = 0
    positive = false
    n = len(s)
    for i in range(n):
        item = s[i]
        if item < 0:
            if max_sum < current_sum:
                max_sum = current_sum
                current_sum = 0
        else:
            positive = true
            current_sum += item
    if (current_sum > max_sum):
        max_sum = current_sum
    if (positive):
        return max_sum
    return -1

